import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import authSlice from './redux/store/Auth';

const root = ReactDOM.createRoot(
  document.getElementById('root') as HTMLElement
);
root.render(
  <React.StrictMode>
    <Provider store={authSlice}>
      <App />
    </Provider>
  </React.StrictMode>
);
